素材や製法、おいしさにこだわった、ちょっと贅沢な明治屋のグルメ缶詰<BR><BR>ジューシーなほぐし牛肉をスパイシーに仕上げました。<BR>茹でたじゃがいもと合わせたり、クラッカーにのせてオードブルとしてなど色々なメニューにお使いいただけます。<BR>ほぐした牛肉の旨みとスパイシーな味付けがウイスキーやビールに良く合います。<BR><BR>缶切不要のプルトップタイプで、いつでもどこでも、手軽に召し上がれます。<BR><BR>「おいしい缶詰」シリーズ･･･素材や製法、おいしさにこだわった、ちょっと贅沢なＲＥＡＤＹ ＴＯ ＥＡＴのグルメ缶詰。<BR>そのままごはんのおかずやお酒のおつまみとして、家庭では再現しにくいメニューをおいしい缶詰で簡単に一品プラス。捨てるのが面倒なオイルなどはパンにつけたり、ドレッシングや炒め物の香り付けにも使えるなど、具材だけでなくソースまでおいしく食べられるよう、味付けにもこだわりました。<BR>※こちらの商品は、お届け地域によって分納・翌日以降のお届けとなる場合がございます。<br>●内容量：90g<BR>※賞味期限について：商品の発送時点で、賞味期限まで残り360日以上の商品をお届けします。<br>●メーカー／明治屋<br>●型番／SOH3641981<br>●JANコード／4902701908127<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

